events.onValueChange:
function(form) {
    if (form.get('Type of visit').getValue() === "Patient Support") {
        form.get('Type of patient support session').setHidden(false);
    } else {
        form.get('Type of patient support session').setHidden(true);
    }

    if (form.get('Type of visit').getValue() === "Initial Consultation" || form.get('Type of visit').getValue() === "Treatment initiation" || form.get('Type of visit').getValue() === "Follow-up visit" || form.get('Type of visit').getValue() === "Lab Test" || form.get('Type of visit').getValue() === "Vaccination") {
        form.get('Vaccine given').setHidden(false);
    } else {
        form.get('Vaccine given').setHidden(true);
    }

    if (form.get('Type of visit').getValue() === "Initial Consultation" || form.get('Type of visit').getValue() === "Treatment initiation" || form.get('Type of visit').getValue() === "Follow-up visit") {
        form.get('Ultrasound performed').setHidden(false);
    } else {
        form.get('Ultrasound performed').setHidden(true);
    }

   if (form.get('Type of visit').getValue() === "Initial Consultation" || form.get('Type of visit').getValue() === "Treatment initiation" || form.get('Type of visit').getValue() === "Follow-up visit" || form.get('Type of visit').getValue() === "Lab Test" ) {
        form.get('Lab test performed').setHidden(false);
    } else {
        form.get('Lab test performed').setHidden(true);
    }

    if (form.get('Type of visit').getValue() === "Initial Consultation" || form.get('Type of visit').getValue() === "Treatment initiation" || form.get('Type of visit').getValue() === "Follow-up visit") {
        form.get('Treatment Regimen').setHidden(false);
    } else {
        form.get('Treatment Regimen').setHidden(true);
    }
}

events.onFormInit:
function(form) {
        form.get('Type of patient support session').setHidden(true);
        form.get('Vaccine given').setHidden(true);
        form.get('Ultrasound performed').setHidden(true);
        form.get('Lab test performed').setHidden(true);
        form.get('Treatment Regimen').setHidden(true);
}
